module.exports = {
  /* Error Messages */
  "INVALID_TOKEN": "Your token is invalid",
  "TOKEN_EXPIRED": "Your token is expired",
  "TOKEN_NOT_FOUND": "Token not found.",
  "INVALID_PARAMS": "Please input your email and password correctly",
  "ERROR_GENERATE_API_TOKEN": "ERROR_GENERATE_API_TOKEN",
  "INVALID_USER": "There is no such user or password is not correct",
  "INVALID_CREDENTIALS": "There is no such user or password is not correct",
};
